def read_symbolic_matrices_from_file(filename):
    matrices = []
    matrix = []

    with open(filename, 'r', encoding='utf-8') as file:
        for line in file:
            line = line.strip()
            if line.startswith("Matrix"):
                if matrix:
                    matrices.append(np.array(matrix))  # ⬅️ convert here
                    matrix = []
            elif line:
                matrix.append(line.split())
        if matrix:
            matrices.append(np.array(matrix))  # ⬅️ and here too
    
    return matrices

# Example usage:
filename = "d:/research/code/Qualitative/1000matrices5.txt"  # Your uploaded file
matrices = read_symbolic_matrices_from_file(filename)
num_generation=[]
all_min_inconsistencies = []
i=0
reliable_count=0
count_in=0
count_odd=0
for matrix in matrices:
    best_matrix,min_inconsistencies, num_generation_each, countin =qualitonumber_convert.main(matrix)
    # best_matrix,min_inconsistencies, num_generation_each =ga_random_inconsistency.main(matrix)
    #best_matrix, num_generation_each =inconsistency_janicki.adjust_matrix(matrix)
    if countin>0:
        count_in +=1
    n = best_matrix.shape[0]
    off_diag = best_matrix[~np.eye(n, dtype=bool)]
    print(off_diag)
    num_indifference = np.sum(off_diag == "≈")
    print(num_indifference)
    total_off_diag = len(off_diag)
    print(total_off_diag)
    if num_indifference % 2 == 1:
        # print(f"Stopped at matrix {idx}: odd number of indifferences ({num_indifference}).")
        count_odd += 1
    # print (count_odd,count_in)
    # Check if 50% or more of off-diagonal elements are "≈"
    if num_indifference / total_off_diag >= 0.5 :
        reliable_count += 1
    #print("min: ",min_inconsistencies)
    # all_min_inconsistencies.append(min_inconsistencies)
    num_generation.append(num_generation_each)
    i+=1
    print(i,num_generation_each)#print(i,main_gp.main(matrix)[1])
print(num_generation,"reliable_count=",reliable_count, "count_odd=",count_odd, "count_incons=",count_in )


